import React from 'react';

function LogIn() {
    return(
        <div className='min-h-screen bg-gray-100'>
        <h1 className='text-center text-5xl mt-10 mb-5'>ServeSavvy</h1>
        
        <h2 class="text-2xl font-bold mb-4">Login</h2>

        <form action="{% url 'login' %}" method="post" class="space-y-6">
            <div class="form-group">
            <input autofocus class="appearance-none block w-full bg-gray-200 text-gray-700 border border-gray-200 rounded py-3 px-4 leading-tight focus:outline-none focus:bg-white focus:border-gray-500" type="text" name="username" placeholder="Username"></input>
            </div>
            <div class="form-group">
            <input class="appearance-none block w-full bg-gray-200 text-gray-700 border border-gray-200 rounded py-3 px-4 leading-tight focus:outline-none focus:bg-white focus:border-gray-500" type="password" name="password" placeholder="Password"></input>
            </div>
            <input class="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline" type="submit" value="Login"></input>
        </form>

        <div class="mt-4">
            Don't have an account? <a href="/Register" class="text-blue-500 hover:text-blue-800">Register here.</a>
        </div>

      </div>
    );
}

export default LogIn;
